import React,{Component} from 'react';
import './Signin.css';
import Input from '../UI/Input/Input';
import '../UI/Input/Input.css';

class Signin extends Component
{
	render()
	{
			return (
				<div>
					<form>
						
						<Input inputtype="input" type="email" name="email" placeholder="Enter your Email" label="email" />
						<Input inputtype="input" type="text" name="email" label="email"/>
					</form>
				</div>
			);
	}
}

export default Signin;
